const LoginPage = () => {
    return(
        <div>
            <h1>Connexion</h1>
            <div>
                <label htmlFor="email">Adresse mail</label>
                <input type="email" name="email" id="email"/>
            </div>

            <div>
                <label htmlFor="password">Adresse mail</label>
                <input type="password" name="password" id="password"/>
            </div>
        </div>
    )
};



export default LoginPage;
